{{Infobox person | name = Rob Huebel | image = Rob Huebel CCI2012.JPG | image_size = 250px | caption = Huebel in July 2012 | birth_name= Robert Anderson Huebel | birth_date = {{birth date and age|1969|6|4}} | birth_place = [[Alexandria, Virginia]], U.S. | occupation = Actor, comedian, writer | yearsactive = 1998–present | children = 1 | website = {{url|http://www.robhuebel.com/}} }}
'''Robert Anderson Huebel'''<ref>{{cite web|url=http://www.clemson.edu/clemsonworld/profiles/07summer/hueble.html|title=Clemson World Magazine|work=Clemson World Magazine|accessdate=7 July 2015}}</ref> (born June 4, 1969) is an [[United States|American]] actor, comedian and writer best known for his [[sketch comedy]] work on the MTV series ''[[Human Giant]]'' and for his role of Dr. Owen Maestro on the [[Adult Swim]] series ''[[Childrens Hospital (TV Series)|Childrens Hospital]]''. He currently stars as Len Novak on the [[Amazon Studios|Amazon]] series ''[[Transparent (TV series)|Transparent]]''.
==Early life== Huebel was born in [[Alexandria, Virginia]], the son of Louisa and Jared Huebel.<ref>{{cite web|url=http://nl.newsbank.com/nl-search/we/Archives?p_product=CS&s_site=thestate&p_multi=CS&p_theme=realcities&p_action=search&p_maxdocs=200&p_topdoc=1&p_text_direct-0=1184809001BA46A8&p_field_direct-0=document_id&p_perpage=10&p_sort=YMD_date:D&s_trackval=GooglePM|title=State: Search Results|website=nl.newsbank.com |accessdate=7 July 2015}}</ref> He attended [[Annandale High School]] in [[Annandale, Virginia]] before attending [[Clemson University]] in South Carolina where he studied Marketing in hopes of working in advertising.<ref name="improvinterviews.com">{{cite web | url = http://www.improvinterviews.com/2006/11/rob-huebel-52306-part-1.html | archiveurl = https://web.archive.org/web/20070523074833/http://www.improvinterviews.com/2006/11/rob-huebel-52306-part-1.html | archivedate= {{date|23 may 2007}} | deadurl = yes | title = Rob Huebel 5/23/06 Part 1 | work = Improv Interviews | date = {{date|15 nov 2006}} | accessdate = {{date|16 jun 2016}} }}</ref> He later moved to New York and began studying improv comedy at the [[Upright Citizens Brigade Theater]].<ref>[http://losangeles.ucbtheatre.com/performers/900 Rob Huebel's Upright Citizens Brigade Theater Profile]</ref>
==Career== {{refimprove|date=September 2017}} Huebel first began improvising when he was 27 by taking classes at the [[Upright Citizens Brigade Theatre]] in [[New York City]].<ref name="improvinterviews.com"/>
His early work was as a sketch actor on shows such as ''[[Late Night with Conan O'Brien]]'' and ''[[Upright Citizens Brigade]]''. He was nominated for an [[Emmy]] award for his work as a producer for [[Michael Moore]]'s Bravo series ''[[The Awful Truth (TV series)|The Awful Truth]]''. He worked as a segment producer on ''[[The Daily Show with Jon Stewart]]''.{{cn|date=November 2017}}
Huebel was a panelist on the [[VH1]] series ''[[Best Week Ever]]'', part of the [[NetZero]] "Candidate Zero" campaign during the 2004 election. He was known for the "Inconsiderate Cell Phone Man" character, shown at movie theatres before showtime. He also appeared on the [[HBO]] television series ''[[Curb Your Enthusiasm]]'', as well as Fox's ''[[Arrested Development (TV series)|Arrested Development]]''.
The comedy partner of [[Rob Riggle]], the duo have worked with the [[improvisational comedy]] troupe [[Respecto Montalban]] and at the [[Upright Citizens Brigade]]. Huebel and Riggle performed a comedy bit in the documentary ''[[Super High Me]]''. Among their best known work at UCB was their long-running two-man show ''Kung-Fu Grip'', which was eventually showcased at the 2004 HBO Comedy Arts Festival. Huebel was in the movie ''[[Blackballed: The Bobby Dukes Story]]'', as Sam Brown with Corddry, Scheer, and Riggle.{{cn|date=November 2017}}
Huebel and fellow comedians [[Aziz Ansari]] and [[Paul Scheer]] are writers, actors, and executive producers in the [[MTV]] sketch comedy show ''[[Human Giant]]''. Some of Huebel's characters from the show include Samir from "The Shutterbugs" and T.C. Everwood from "Clell Tickle". He guest starred in the ''[[30 Rock]]'' episode "[[MILF Island]]", and also as Holly's boyfriend A.J. in three episodes of ''[[The Office (U.S. TV series)|The Office]]''. He played the role of 'Tevin' in the 2009 comedy ''[[I Love You, Man]]''. He also co-starred with [[Rob Corddry]] in ''[[Childrens Hospital (TV Series)|Childrens Hospital]]''.
Huebel continues to regularly perform at the [[Upright Citizens Brigade Theatre]] in Los Angeles. He currently co-hosts the live sketch show "Crash Test" with [[Paul Scheer]] twice a month, as well as hosting "The Shit Show", in which he gathers comedian friends and other well-known performers to present the worst scenes in films, television and commercials that they have ever done.{{cn|date=November 2017}}
Huebel has written and starred in various filmed sketches for the [[HBO]] sketch comedy program ''[[Funny or Die Presents]]''. In November 2010, Huebel performed stand-up on ''[[The Benson Interruption]]'' on [[Comedy Central]].
Huebel appeared in the films ''[[The Other Guys]]'' (2010), ''[[Life as We Know It (film)|Life as We Know It]]'', ''[[Little Fockers]]'', ''[[Despicable Me]]'', and ''[[The Descendants]]''. In February 2011, Huebel was cast as a lead in the [[Fox Broadcasting Company|Fox]] sitcom pilot ''Family Album'' and in May he guest starred on [[American Broadcasting Company|ABC]]'s sitcom, ''[[Modern Family]] ''as Glen Whipple in the episode "[[The One That Got Away (Modern Family)|The One That Got Away]]". He also appeared as a semi-regular castmember on [[Amazon Studios]]'s ''[[Transparent (TV series)|Transparent]]'', playing Len Novak.{{cn|date=November 2017}}
Huebel appears frequently on the comedy podcast ''[[Comedy Bang! Bang!]]''<ref>{{cite web|url=http://www.earwolf.com/person/rob-huebel|title=Rob Huebel on Earwolf|publisher=|accessdate=7 July 2015}}</ref> along with starring in his own podcast series on the [[Earwolf]] network, ''Mike Detective''.<ref>{{cite web|url=http://www.earwolf.com/show/mike-detective|title=Mike Detective|publisher=|accessdate=7 July 2015}}</ref> He later appeared in ''[[Horrible Bosses 2]]'' (2014) and ''[[Barely Lethal]]'' (2015).
==Personal life== Huebel is married; his daughter was born in 2016.<ref>{{Cite web|url=https://www.instagram.com/p/BM7MubQgzvu/?taken-by=robhuebel&hl=en|title=Instagram post by Rob Huebel • Nov 17, 2016 at 8:39pm UTC|website=Instagram|language=en|access-date=2017-02-25}}</ref>
